import React, { useEffect, useState } from 'react';
import {
    Dialog,
    DialogContent,
    DialogTitle,
    Typography,
    Chip,
} from '@mui/material';


export default function ApptDialog({ selectedStartTimes, doctorUniqId, id, dialogOpen, handleCloseDialog, selectedDate, doctorsAvailability, setSelectedStartTime, handleBooking }) {

    const [selectedDoctorInfo, setSelectedDoctorInfo] = useState(null);

    useEffect(() => {
        const doctorInfo = doctorsAvailability.find(doctor => doctor.doctorId === doctorUniqId);
        setSelectedDoctorInfo(doctorInfo);
    }, [doctorsAvailability, doctorUniqId]);

    return (
        <div>
            <Dialog open={dialogOpen} onClose={handleCloseDialog} minWidth="md" fullWidth>
                <DialogTitle style={{ fontSize: '17px', fontWeight: "550" }}>
                    {selectedDoctorInfo ? `Dr. ${selectedDoctorInfo.doctorName}` : "Doctor Name"}
                </DialogTitle>
                <DialogContent style={{ marginTop: '-1rem' }}>
                    <Typography variant="body2">
                        {selectedDoctorInfo ? selectedDoctorInfo.specialist : "Specialist"}
                    </Typography>
                    <Typography variant="body2" style={{ color: "grey" }}>Selected Date: {selectedDate}</Typography>
                    <Typography variant="body2" style={{ color: "grey" }}>Available Start Times:</Typography>
                    {selectedStartTimes.map((startTime, index) => (
                        <Chip
                        style={{ padding: "1rem", borderRadius: "2px", margin: '0.3rem', background: "yellow" }}
                            key={index}
                            label={startTime}
   
                            className="mt-2"
                            onClick={() => {
                                setSelectedStartTime(startTime);
                                handleBooking(doctorUniqId, id);
                            }}
                        />
                    ))}
                </DialogContent>
            </Dialog>
        </div>
    );
}
